- var pg = require('pg'); 
  //构造连接数据库的连接字符串："tcp://用户名:密码@ip/相应的数据库名"   
  var conString = "tcp://postgres:postgres@localhost/test";  
  var client = new pg.Client(conString);  //构造数据库对象 
  client.connect(function (error,results) {
      if (error) {
          console.log('数据库链接失败' + error.message);
          client.end();
          return;
      }
      console.log('数据库连接成功');
  });
